import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Routes from './config/routes';
import AdminHome from './pages/Admin'

import './App.scss';

function App() {
  return (
    <Router>
      <Switch>
        <Route exact={true} path="/" component={AdminHome} />
      </Switch>
    </Router>
  );
}

export default App;
